import React from "react";
import logoLambentData from "../icons/logoLambentData.jpeg";
import './components/components.css'; // here is where the magic happens

const TopNav = () => {
  return (
    <div>
      <div>
        <img className="top"src={logoLambentData} alt="Logo" />
      </div>
      <div>
        Container for the last two
        <div>settings</div>
        <div>help</div>
      </div>
    </div>
  );
};

export default TopNav;
